import React, {useState} from 'react';
import styles from './batch.styles';
import Button from '@material-ui/core/Button';
import {withStyles} from '@material-ui/core';
import Table from '@material-ui/core/Table';
import TableHead from '@material-ui/core/TableHead';
import TableBody from '@material-ui/core/TableBody';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const dummyBatch = [
    {title: "Batman Begins",
    imdbId: "tt0372784"}
];

const Batch = (props:any) => {
    const {batchList} = props;
    const {classes} = props;

    return(
        <div>
            <Grid container justify="center">
                <Paper className={classes.root}>
                    <Table aria-label="simple table" className={classes.dataTable}>
                        <TableHead>
                            <TableRow>
                                <TableCell align="left">Movie Title</TableCell>
                                <TableCell align="left">IMDB ID</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {dummyBatch.map((listing:any) => (
                                <TableRow key={listing.title}>
                                    <TableCell align="left">{listing.title}</TableCell>
                                    <TableCell align="left">{listing.imdbId}</TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </Paper> 
                <br/>
                <Grid item>
                    <Button variant="outlined"
                        className={classes.submitButton}
                        onClick={() => console.log('Activando el Batcheo')}>Process Batch</Button>
                </Grid>
            </Grid>                 
        </div>
    );
}

export default withStyles(styles)(Batch);
